description:
A collection of the well-known stories, including &quot;How the Whale
Got His Throat, &quot; &quot;The Elephant&#39;s Child, &quot; and
&quot;The Butterfly That Stamped.&quot;

Nora Roberts returns to Chesapeake Bay and her beloved Quinn family
for the long-awaited conclusion to the breathtaking drama that began
with &quot;Sea Swept, Rising Tides&quot; and &quot;Inner Harbor.&quot;

&quot;A humorous compendium for the electronic age, comprising 320
fun-filled pages of the very best (and worst) of internet
humour.&quot;

12 unusually attractive Amish quilts include &quot;Sunshine and
Shadow,&quot; &quot;Monkey Wrench,&quot; &quot;Crown of Thorns,&quot;
&quot;Jacob&#39;s Ladder,&quot; and 8 more.

Jana Morgan and the other members of the &quot;Fabulous Five&quot;
encounter new challenges as they move on to Wakeman Junior High School
and discover new rivals, &quot;The Fantastic Foursome&quot;

The cubs are putting their great dog show idea into motion and plan
for it to be a great success, but when Too-Tall and the gang appear,
absolute chaos soon follows. Simultaneous.

An enchanting anthology of the best-loved Bible stories of all time
includes &quot;Daniel in the Lion&#39;s Den,&quot;The Night the Angel
Came,&quot; and &quot;The First Noah&#39;s Ark.&quot;

While on summer holidays in 1936, fourteen-year-old Evan meets a
mysterious girl who bears a striking resemblance to the Alice of
&quot;Alice&#39;s Adventures in Wonderland.&quot;

Explores Mir o&#39;s life and development as an artist, his entry into
surrealism, and his versatility in abstract expression. Includes a
brief history of art.&quot;

&quot;Roz Bailey&#39;s trio of fabulous 30-something Manhattanites are
still the eponymous &quot;Party Girls&quot; in this &quot;Sex and the
City&quot;-style urban romp.&quot;--&quot;Publishers Weekly.&quot;

The Borrowers, a family of miniature people, journey down a drain,
live briefly in a teakettle, and are swept away in a flood before
finding a new home. Sequel to &quot;The Borrowers Afield.&quot;

The author offers a collection of her finest science fiction stories
of the 1990s, including the award-winning novella &quot;Beggars in
Spain&quot;

An irresistible handbook for island living! Lowry has combed Nantucket
for months to review hundreds of restaurants, b&amp;b inns, hotels,
shops, galleries, beaches, and more.

Advocates that the Madrigal method can teach the reader to read,
write, speak, and think Spanish, even though the reader says &quot;I
can&#39;t&quot;

Includes anecdotes by &quot;Erma Bombeck, James Dobson, Ruth Bell
Graham, Philip Gulley, Robin Jones Gunn, Max Lucado, Joni Eareckson
Tada, and many more.&quot;

Bauman, an educated man, convicted of killing a young girl while
driving drunk, is coerced by the prison administration into trying to
track down the killer of &quot;lifers.&quot;

First performed in 1594, &quot;Love&#39;s Labour&#39;s Lost&quot;
features such typical Shakespearean elements as lovers in disguise, a
witty clown, and an abundance of sparkling repartee.

After suffering an accident with her horse, Snow White, during
practice, Lulu becomes too scared to get in the saddle again and
considers leaving the Pony Pals. Original.&quot;

Chronicling a family&#39;s migration from rural areas to a city, the
story offers a glimpse into the traditions, religious beliefs,
symbolic art, and secret rituals of the Ndebele people.&quot;

Mais quelle honte pourrait m&#39;apporter l&#39;écriture d&#39;un
livre qui soit à la hauteur de ce que j&#39;ai éprouvé dans ma
douzième année.&quot;

The humorist author of Dave Barry Turns 50 takes on a familiar topic--
the male animal--in a hilarious guide to &quot;guy&quot; behavior,
issues, and character. Reprint. quot;prostate&quot;

This third edition of &#39;The Trial and Death of Socrates&#39;
presents G. M. A. Grube&#39;s distinguished translations, as revised
by John Cooper for &#39;Plato, Complete Works&#39;.

The author&#39;s chronicle of his year-long trek through Alaska
introduces the people and places of the nation&#39;s &quot;last
frontier.&quot;

Works by more than 60 Irish poets, from 18th century to modern times,
includepoems bySwift, Goldsmith, Moore; Allingham, Yeats, Joyce; plus
verses by lesser-known poets.&quot;

Gathers a collection of eight fairy-tale princess stories from around
the world that include &quot;The princess and the pea,&quot;
&quot;King Grizzle-beard,&quot; and &quot;The twelve dancing
princesses&quot;

Vhere? Discover what&#39;s there and where to find it; pinpoint
directions and inside tips for Central America&#39;s top destinations;
20 color maps, including all the best birdwatching parks.

Will Laura get to know the who wrecked his bike at her curb? Find out
in &quot;Just Don&#39;t Make a Scene, Mum!.&quot; &quot;Cool,
diverting comedy.&quot;--&quot;The London Times.&quot;

&quot;When We Were Very Young&quot; and &quot;Now We Are Six&quot;
complete the four-volume set of deluxe editions of the Milne and
Shepard classic works.

Collects stories by the Hugo award-winning author, including
&quot;Heroics,&quot; Big Guy,&quot; and &quot;The First Law of
Thermodynamics&quot;

From the bestselling author of &quot;The Princess Diaries.&quot;
Growing up in India, 16-year-old heiress Lady Victoria Arbutnot is
unceremoniously shipped off to London to find a husband.

The bestselling author of &quot;Son&quot; and &quot;Doc&quot;
investigates a chilling series of alleged murders that exposes the
sinister underworld of Gypsy culture in America. 8-page photo insert.

After being in detention with a girl called &quot;The Freak,&quot;
Megan finds herself torn between the developing friendship the two
share and her involvement with a popular clique.

A rootless young Westerner believes he has stumbled upon paradise on a
remote island off Thailand, a place known as &quot;The Beach,&quot;
until he discovers the deadly underside of the island&#39;s culture

Roald Dahl&#39;s uproarious sequel to &quot;Charlie and the Chocolate
Factory&quot; is certain to delight and entertain a new generation of
readers. &quot;From the Hardcover edition.&quot;

Gathers twenty-four science fiction stories, including &quot;We Can
Remember It for You Wholesale,&quot; &quot;Second Variety,&quot;
&quot;The Golden Man,&quot; and &quot;The Last of the Masters&quot;

The staff photographer for the &quot;Philadelphia Inquirer&quot;
presents intimate pictures and lively personal anecdotes for readers
nostalgic for their own hometown diner. 145 photos, 125 in color.

This book is divided into three main sections, 50 lessons in all;
lesson one through 22 cover Eighth Notes, Syncopation, Dotted Notes,
The Triplet and Accents.

Suggestions for spreading the spirit of Christmas to family and
friends include &quot;always get a Christmas tree that&#39;s a little
too big for the room,&quot; and &quot;be easy to please&quot;

This book about South America &quot;emphasizes the land and its
features, and the animals and plants in all their wonderful
variety.&quot;

After her passionate marriage deteriorates into a violent nightmare,
Fran Benedetto is forced to start a new life, complete with a new
identity quot;a national treasure.&quot;

Inside these pages you&#39;ll find Mary&#39;s colorful artwork joined
with verse that says &quot;thanks for everything you&#39;ve
done.&quot;

In an attempt to answer the question What is art?, the stories explore
Italian ?art,” Mexican ?art,” Gypsy ?art,” Native ?art,” and political
?art.&quot;

Haunted is the fifth book in the thrilling, romantic Mediator series,
from the New York Times bestselling author of the Princess Diaries,
Meg Cabot.

Collects installments for the ongoing comic book series &quot;Way of
the Rat,&quot; &quot;Mystic,&quot; &quot;Scion,&quot;
&quot;Sigil,&quot; &quot;Ruse,&quot; and &quot;The First,&quot;
ranging from Victorian mystery to medieval fantasy to space action.

Answers such common childhood questions about bellybuttons as
&quot;Why do some stick out?&quot; and &quot;Why do I have to keep it
clean anyway?&quot;

A guide for writers of fiction includes a cross-referenced Alphabet
for Writers that deals with such writing concerns as anti-heroes,
dialogue, sex, and style. Reprint.

Offers the story of Kim Phuc, known as the &quot;napalm girl&quot;
after being photographed fleeing, naked, from an attack on her South
Vietnamese village, and her struggle against war and publicity.
